import React, { Component } from 'react';
import NavBar from './components/NavBar';
import './App.css';

import { eel } from './eel.js';

class App extends Component {
  constructor(props) {
    super(props);
    eel.set_host('ws://localhost:8888');
    eel.hello();
  }
  render() {
    return (
      <Router>
        <NavBar />
      </Router>
    );
  }
}

export default App;
